class Solution:    def minSubArrayLen(self, s, nums):        """        :type s: int        :type nums: List[int]        :rtype: int        """        n=len(nums)        if n==0:            return        left,sum1,min_length=0,0,n        for right in range(n):            sum1+=nums[right]            while sum1>s:                sum1-=nums[left]                min_length=min(right-left+1,min_length)                left+=1        return min_lengths=Solution()s.minSubArrayLen(7,[2,3,1,2,3,4])